# Place your machine_vendor_list function after this line
def machine_vendor_list(file_name: str, vendor: str) -> list[dict]:
    """
    The Purpose of the machine_vendor_list() function is to take a inputed file and a 'vendor' attribte type.
    A list of dictionaries that correspond to the 'vendor' type is returned, with each key being an attribute of the files data excluding 'Vendor'.

    Precondition: Inputted file is 'machine.csv' and the two parameters are input as strings.
    Examples:
    >>> machine_vendor_list('machine.csv','adviser')
    [{'model': '32/60', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199}]
    >>> machine_vendor_list('machine.csv','amdahl')
    [{'model': '470v/7', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 269, 'ERP': 253}, {'model': '470v/7a', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 220, 'ERP': 253}, {'model': '470v/7b', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 172, 'ERP': 253}, {'model': '470v/7c', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 16000, 'CACH': 32, 'PRP': 132, 'ERP': 132}, {'model': '470v/b', 'MYCT': 26, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 64, 'PRP': 318, 'ERP': 290}, {'model': '580-5840', 'MYCT': 23, 'MMIN': 16000, 'MMAX': 32000, 'CACH': 64, 'PRP': 367, 'ERP': 381}, {'model': '580-5850', 'MYCT': 23, 'MMIN': 16000, 'MMAX': 32000, 'CACH': 64, 'PRP': 489, 'ERP': 381}, {'model': '580-5860', 'MYCT': 23, 'MMIN': 16000, 'MMAX': 64000, 'CACH': 64, 'PRP': 636, 'ERP': 749}, {'model': '580-5880', 'MYCT': 23, 'MMIN': 32000, 'MMAX': 64000, 'CACH': 128, 'PRP': 1144, 'ERP': 1238}]
    >>> machine_vendor_list('machine.csv','apollo')
    [{'model': 'dn320', 'MYCT': 400, 'MMIN': 1000, 'MMAX': 3000, 'CACH': 0, 'PRP': 38, 'ERP': 23}, {'model': 'dn420', 'MYCT': 400, 'MMIN': 512, 'MMAX': 3500, 'CACH': 4, 'PRP': 40, 'ERP': 24}]
    """
    vendor_personal = []

    csv = open(file_name, 'r')

    first_line = True

    for column in csv:

        if not first_line:

            line = column.split(',')

            if line[0] == vendor:
                vendor_personal.append(
                    {'model': line[1], 'MYCT': int(line[2]), 'MMIN': int(line[3]), 'MMAX': int(line[4]),
                     'CACH': int(line[5]), 'PRP': int(line[6]), 'ERP': int(line[7])})

        first_line = False

    csv.close()

    return vendor_personal


