# Place your machine_model_list function after this line
def machine_model_list(filename: str, machine_model: str) -> list[dict]:
    """
    Checks the file passed and returns list of machines as dicts of their attributes (keys are labels of
    attributes) of which model is the one passed

    Preconditions: Filename must be the name of a file in the same folder as the file for this code
    Examples:
    >>> machine_model_list('machine.csv', '32/60')
    [{'vendor': 'adviser', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199}]
    >>> machine_model_list('machine.csv', 'not_valid_model')
    []
    >>> machine_model_list('machine.csv', '470v/7')
    [{'vendor': 'amdahl', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 269, 'ERP': 253}]
    """
    machines = []  # array that will be returned and hold dicts
    infile = open(filename, "r")  # open file

    first_line = True  # used to not print title line

    # for each line in the file who's model is the one called, add info as dict to machines (list)
    for line in infile:
        if not first_line:  # first line isn't info, but headers
            # put data from each column of the line into a list
            line_data = line.split(',')

            if line_data[1] == machine_model:  # check if model is one called
                # append list of needed info from file onto list (to be returned) as a dict
                machines.append({'vendor': line_data[0], 'MYCT': int(line_data[2]), 'MMIN': int(line_data[3]),
                                 'MMAX': int(line_data[4]), 'CACH': int(line_data[5]), 'PRP': int(line_data[6]),
                                 'ERP': int(line_data[7])})

        first_line = False
    infile.close()  # close file
    return machines


