# Place your machine_prp_list function after this line
def machine_prp_list(file_name, prp_min):
    """
    The purpose of machine_prp_list is to, when called and provided a file name and cache amount, return all
    machines along with their attributes, excluding prp itself, which have the minimum specified prp.

    Preconditioins: File name must be the name of the file in the same folder as this script
    Examples:
    >>> machine_prp_list('machine.csv', 1144)
    [{'Vendor': 'amdahl', 'Model': '580-5880', 'MYCT': 23, 'MMIN': 32000, 'MMAX': 64000, 'CACH': 128, 'ERP': 1238}, {'Vendor': 'sperry', 'Model': '1100/94', 'MYCT': 30, 'MMIN': 8000, 'MMAX': 64000, 'CACH': 128, 'ERP': 978}]
    >>> machine_prp_list('machine.csv', 1300)
    []
    >>> machine_prp_list('machine.csv', 636)
    [{'Vendor': 'amdahl', 'Model': '580-5860', 'MYCT': 23, 'MMIN': 16000, 'MMAX': 64000, 'CACH': 64, 'ERP': 749}, {'Vendor': 'amdahl', 'Model': '580-5880', 'MYCT': 23, 'MMIN': 32000, 'MMAX': 64000, 'CACH': 128, 'ERP': 1238}, {'Vendor': 'sperry', 'Model': '1100/93', 'MYCT': 30, 'MMIN': 8000, 'MMAX': 64000, 'CACH': 96, 'ERP': 919}, {'Vendor': 'sperry', 'Model': '1100/94', 'MYCT': 30, 'MMIN': 8000, 'MMAX': 64000, 'CACH': 128, 'ERP': 978}]
    """
    # Initializes a list for machines with the minimum PRP or greater
    min_machine_prp = []

    # Open the CSV file
    with open(file_name, 'r') as file:

        # Read all file lines
        lines = file.readlines()

        # Splits header into list of machine attribute names
        header_line = lines[0].strip()
        attributes = header_line.split(',')

        # Find the index of the PRP values
        prp_of_index = attributes.index('PRP')

        # Iterates through the lines
        for line in lines[1:]:

            # Splits the line into values
            values = line.strip().split(',')

            # Convert PRP to int if within index range
            if prp_of_index < len(values):
                prp_integer = int(values[prp_of_index])
            else:
                prp_integer = 0

            # Loops through converting attributes to integers
            for i in range(len(values)):
                if attributes[i] in {'MYCT', 'MMIN', 'MMAX', 'CACH', 'ERP'}:
                    values[i] = int(values[i])

            # Check if PRP meets the minimum or greater value
            if prp_integer >= prp_min:
                # Creates a dictionary of the machine attributes
                machine_attributes = dict(zip(attributes, values))
                # Removes PRP from dictionary
                machine_attributes.pop('PRP', None)

                # Appends the machines to the list of minimum or greater PRP values
                min_machine_prp.append(machine_attributes)

    # Returns a list of machines with the minimum PRP values
    return min_machine_prp


