# Place your add_average_main_memory function after this line
def add_average_main_memory(machine_list: str) -> list[dict]:
    """
    The purpose of add_average_main_memory is to, for the provided list of machine dictionaries, add the average main
    memory rounded to 2 decimal places as an additional attribute.

    Preconditions: The list format must be of the same format as provided in the examples below.
    Examples:
    >>> add_average_main_memory([{'Vendor': 'adviser', 'Model': '32/60', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199}])
    [{'Vendor': 'adviser', 'Model': '32/60', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199, 'M_AVG': 3128.0}]
    >>> add_average_main_memory([{'Vendor': 'adviser', 'Model': '32/60', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199}, {'Vendor': 'amdahl', 'Model': '470v/7', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 269, 'ERP': 253}])
    [{'Vendor': 'adviser', 'Model': '32/60', 'MYCT': 125, 'MMIN': 256, 'MMAX': 6000, 'CACH': 256, 'PRP': 198, 'ERP': 199, 'M_AVG': 3128.0}, {'Vendor': 'amdahl', 'Model': '470v/7', 'MYCT': 29, 'MMIN': 8000, 'MMAX': 32000, 'CACH': 32, 'PRP': 269, 'ERP': 253, 'M_AVG': 20000.0}]
    >>> add_average_main_memory([])
    []
    """
    for machine in machine_list:
        average_memory = round((machine['MMAX'] + machine['MMIN']) / 2, 2)
        machine['M_AVG'] = average_memory

    return machine_list
